</style><style type="text/css">.bl-info-container {
  box-sizing: border-box;
  width: 100%;
  padding: 0;
  margin: 0;
  font-size: 12px;
}
.bl-info-header {
  display: flex;
  height: 24px;
  width: 100%;
  padding: 0;
  justify-content: space-between;
  cursor: pointer;
  box-sizing: border-box;
  margin-bottom: 5px;
}

.bl-info-header .row {
  display: flex;
  margin: 0;
  width: 100%;
  justify-content: space-between;
}

.bl-info-header .row.youtube {
  justify-content: flex-start;
}

.bl-info-content,
.kw-info-content {
  width: 100%;
  display: flex;
  flex-direction: column;
  border: 1px solid #dee1e5;
  border-radius: 8px;
  padding-top: 0;
}

body[data-dt='1'] .kw-info-content,
body[data-dt='1'] .bl-info-content {
  background: #2a2a2a;
  border-color: #2a2a2a;
}

.bl-info-content img.loading {
  width: 50px;
  margin: 0 auto;
  margin-bottom: 10px;
}

.kw-info-content img.loading {
  width: 50px;
  margin: 0 auto;
  margin-top: 10px;
  margin-bottom: 10px;
}

table.bl-info-table,
table.kw-info-table {
  border-collapse: collapse;
  width: 100%;
  color: #808185;
  font-size: 12px;
}

body[data-dt='1'] table.bl-info-table,
body[data-dt='1'] table.kw-info-table {
  color: #fff;
}

.bl-info-table thead,
.kw-info-table thead {
  height: 50px;
}

.bl-info-table tr,
.kw-info-table tr {
  width: 100%;
  max-width: 600px;
}

.bl-info-table th,
.kw-info-table th {
  padding: 10px;
  padding-left: 0;
  font-weight: bold;
  color: #000000;
  font-size: 11px;
  border-bottom: 1px solid #dee1e5;
}

body[data-dt='1'] .bl-info-table th,
body[data-dt='1'] .kw-info-table th {
  color: #fff;
}

.bl-info-table th:first-child,
.kw-info-table th:first-child {
  padding-left: 16px;
}

.bl-info-table th:last-child,
.kw-info-table th:last-child {
  border-right: none;
  padding-right: 16px;
}

.bl-info-table td,
.kw-info-table td {
  border-bottom: 1px solid #dee1e5;
  padding: 10px;
  padding-left: 0;
  max-width: 0;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  color: #000;
}

body[data-dt='1'] .bl-info-table td,
body[data-dt='1'] .kw-info-table td {
  color: #fff;
}

.bl-info-table td:first-child,
.kw-info-table td:first-child {
  border-left: none;
  padding-left: 16px;
}

.bl-info-table td:last-child,
.kw-info-table td:last-child {
  border-right: none;
  padding-right: 16px;
}

.bl-info-table tfoot tr:last-child td,
.kw-info-table tfoot tr:last-child td {
  border-bottom: none;
}

.bl-info-container .row {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-top: 10px;
  margin-bottom: 20px;
}
</style><style type="text/css">.statistics-graph-container {
  box-sizing: border-box;
  width: 100%;
  margin-bottom: 5px;
  font-size: 12px;
  padding: 0px 16px;
}

.statistics-graph-container .row {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 10px 0 20px 0;
}

.statistics-graph-container .row .title {
  color: #26282d;
  font-size: 17px;
  font-weight: bold;
}

.statistics-graph-container .tabs {
  list-style: none;
  display: flex;
  justify-content: flex-start;
  border-bottom: 1px solid #dee1e5;
  margin: 0 -16px;
  margin-bottom: 10px;
  margin-top: -10px;
  padding: 0px 16px;
}

.statistics-graph-container .tabs li {
  display: flex;
  align-items: center;
  padding: 8px 16px;
  color: #000;
  cursor: pointer;
  font-size: 13px;
  border-bottom: 3px solid transparent;
}

.statistics-graph-container .tabs li:first-child {
  margin-left: -16px;
}

.statistics-graph-container .tabs li.active {
  color: #4285f4;
  border-bottom: 3px solid #4285f4;
}

/* Google Dark Theme */
body[data-dt='1'] .statistics-graph-container .row .title {
  color: #fff;
}

body[data-dt='1'] .statistics-graph-container .tabs {
  border-bottom: 1px solid #dee1e5;
}

body[data-dt='1'] .statistics-graph-container .tabs li {
  color: #fff;
}

body[data-dt='1'] .statistics-graph-container .tabs li.active {
  color: #fff;
  border-bottom: 3px solid #fff;
}
