	function placeSearch(search_query,container_id,is_for=''){
		var form_data = {
			search_query : search_query
		}
		var resp_data_format="";
		if(search_query.length>1){
			$.ajax({
				url:base+"city/search_city.php",
				data : form_data,
				method : "post", 
				dataType : "json",
				success : function(response) {
					for (var i = 0; i < response.length; i++) {
						resp_data_format=resp_data_format+"<li class='select_country"+is_for+" custom-places' data-city_name='"+response[i].city_name+"' data-latitude='"+response[i].latitude+"'  data-longitude='"+response[i].longitude+"' ><img style='height: 15px;' src="+place_icon+"> "+response[i].city_name+"</li>";
					};
					$("#"+container_id).show();
					$("#"+container_id).html(resp_data_format);
				}
			});
		}else{
			$("#"+container_id).html(resp_data_format);
		}
	}
